import React from 'react'
import ReactDOM from 'react-dom'


const App = (votes) => {
    const title = 'Give feedback';


    return (
        <div>
            <Header title={title}/>
            <Buttons votes={votes}/>
            <Table votes={votes}/>
        </div>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'))
